import { useState } from "react";
import ChatBox from "src/views/ChatBox/ChatBox";
import TableCard from "src/views/table/TableCard";

const TaskInProgress=()=>{

  const [open,setOpen]=useState(false);


  const Open=()=>{
     setOpen(!open);
  }

     const columns = [
        {
          dataField: "#taskId",
          text: "#taskId",

        },
        {
          dataField: "title",
          text: "Title",

          sort: true
        },
        {
          dataField: "writerName",
          text: "Writer Username",

        },
        {
          dataField: "email",
          text: "email",

        },
        {

            dataField: "status",
            text: "status",


        },
        {

            dataField: "category",
            text: "Category",


        },
        {

          dataField: "Adate",
          text: "Accepted-Date",


      },
      {

        dataField: "ddate",
        text: "Deadline",


      },
        {
            dataField: "Action",
            text: "Action",

          }
      ];

      const Buttons = ()=>{
             return <>
                   <button onClick={()=>Open()} style={{marginRight:"3px"}} className="btn btn-primary fa fa-comment"></button>
                   <button className="btn btn-warning">Cancel</button>
                   </>
      }
      const products=[
        {
           "#taskId":"686787678",
           title:"iuytfrdfgh",
           writerName:"wilson",
           email:"wilson@gmail.com",
           status:"in-progress",
           category:"Lorem",
           Adate:'2011-9-10',
           ddate:"2011-8-8",
           Action:Buttons()

        }
    ]
    return <>
             <TableCard 
             products={products}
             columns={columns}
              title={"ORDERS-IN-PROGRESS"}
             />
             <ChatBox open={open} SetOpen={Open}/>
          </>

}

export default TaskInProgress;
